import { NgModule } from '@angular/core';
import { RouterModule, Routes } from '@angular/router';
import { ApplicationLayoutComponent } from './Common/layouts/application-layout/application-layout.component';

const routes: Routes = [
  {
    path: '',
    redirectTo: 'subscription',
    pathMatch: 'full',
  },
  {
    path: '',
    component: ApplicationLayoutComponent,
    children: [
      {
        path: '',
        loadChildren: () => import('../app/Common/layouts/application-layout/application-layout.module').then(x => x.ApplicationLayoutModule)
      }]
  },
  { path: 'subscription', loadChildren: () => import('../Pages/subscriptions/subscriptions.module').then(m => m.SubscriptionsModule) },

];

@NgModule({
  imports: [RouterModule.forRoot(routes)],
  exports: [RouterModule]
})
export class AppRoutingModule { }
